import React from "react";
import FulsoreLogo from "../../assests/fulsorelogo.jpeg"; // Correct relative path

function Navbar() {
  return (
    <div>
      {/* upper Navbar */}
      <div>
        <div>
          <div>
            <a href="#">
              <img src={FulsoreLogo} alt="LOGO" /> {/* Correct usage */}
            </a>
          </div>
        </div>
      </div>
      {/* lower navbar */}
      <div></div>
    </div>
  );
}

export default Navbar;
